import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import App from "../App";

const Loginbox = () => {
  return (
    <div>
      <h2>Welcome Back</h2>
      <BrowserRouter>
        <Route path="/" component={App} />
      </BrowserRouter>
    </div>
  );
};

export default Loginbox;
